import {Navigation} from './index.js';

import './about.css'

export function About(props){
	fetch('http://localhost:1337/api/education', {
		method: 'GET',
		headers: {
			'Authorization': 'f3a643118a07253509193769d4a07e220a5e42a34f8965cc092aea3ea31990256831ab9b6d0691d363acdbaa0adc429b387ff0515a756ac546775ca350003bd0535346f55641697cf731b9248f49b02d202ac44a7f1d1aaa27e36b3a5c4a624ffd75e7ae261bffa6f6dfe734b416eb4a76e51f7957be84fa8ebf04aad25126ce',
			'Content-Type': 'application/json',
		},
	})
	.then(response => response.json())
	.then(data => console.log(data));

	let component = (
			<div>
				<Navigation highlight='about'/>
			</div>
	);
	return component; 
}

